"use strict";(self.webpackChunksolide_docs=self.webpackChunksolide_docs||[]).push([[849],{6164:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"\ud83d\udc4b Introduction","href":"/docs/intro","docId":"intro","unlisted":false},{"type":"link","label":"\u26d3\ufe0f Support Chains","href":"/docs/supported-chains","docId":"supported-chains","unlisted":false},{"type":"category","label":"\ud83d\udca1 Solide IDEs","collapsible":false,"items":[{"type":"category","label":"\ud83d\udfe3 Solide","items":[{"type":"link","label":"Import Contract Address","href":"/docs/ide/sol-ide-contract","docId":"ide/sol-ide-contract","unlisted":false},{"type":"link","label":"Import Github Repository","href":"/docs/ide/sol-ide-github","docId":"ide/sol-ide-github","unlisted":false}],"collapsed":true,"collapsible":true},{"type":"link","label":"\ud83d\udfe1 Movide","href":"/docs/ide/move-ide","docId":"ide/move-ide","unlisted":false},{"type":"link","label":"\ud83d\udfe2 Swayide","href":"/docs/ide/sway-ide","docId":"ide/sway-ide","unlisted":false},{"type":"link","label":"\ud83d\udd35 Stylide","href":"/docs/ide/stylus-ide","docId":"ide/stylus-ide","unlisted":false},{"type":"link","label":"\ud83d\udd35 Aspectide (Comming Soon)","href":"/docs/ide/aspect-ide","docId":"ide/aspect-ide","unlisted":false}],"collapsed":false},{"type":"category","label":"\ud83c\udf93 Proof of Learn","collapsible":true,"items":[{"type":"link","label":"Introduction","href":"/docs/pol/intro","docId":"pol/intro","unlisted":false},{"type":"link","label":"Contribution","href":"/docs/pol/contribution","docId":"pol/contribution","unlisted":false},{"type":"category","label":"\ud83d\udd0e Quest","collapsible":true,"items":[{"type":"link","label":"Deployment","href":"/docs/pol/quest/quest-deployment","docId":"pol/quest/quest-deployment","unlisted":false},{"type":"link","label":"Transaction","href":"/docs/pol/quest/quest-transaction","docId":"pol/quest/quest-transaction","unlisted":false}],"collapsed":true}],"collapsed":true},{"type":"category","label":"\u2699\ufe0f Tools","collapsible":true,"items":[{"type":"link","label":"\ud83d\udd0c Web3 Plugin Contracts","href":"/docs/tools/web3-contract-plugin","docId":"tools/web3-contract-plugin","unlisted":false},{"type":"link","label":"\ud83e\udded Solidity Database","href":"/docs/tools/solidity-database","docId":"tools/solidity-database","unlisted":false},{"type":"link","label":"\ud83d\udc53 Awesome Solidity Learn","href":"/docs/tools/awesome-solidity-learn","docId":"tools/awesome-solidity-learn","unlisted":false}],"collapsed":true},{"type":"category","label":"Socials","collapsible":false,"collapsed":false,"items":[{"type":"link","label":"\u2b50 X (Twitter)","href":"https://x.com/SolideProject"},{"type":"link","label":"\u2b50 Github","href":"https://github.com/solide-project"}]}]},"docs":{"ide/aspect-ide":{"id":"ide/aspect-ide","title":"Aspectide (Coming Soon!)","description":"AspectIDE is a cutting-edge integrated development environment (IDE) designed to streamline the development of smart contracts across multiple blockchain platforms. With its robust and intuitive interface, AspectIDE provides developers with powerful tools for writing, testing, and deploying smart contracts seamlessly. The IDE supports a range of blockchain languages and standards, offering features such as real-time syntax highlighting, automated code completion, and integrated debugging. AspectIDE aims to enhance productivity and simplify the development process, making it easier for developers to build and manage their blockchain projects efficiently.","sidebar":"tutorialSidebar"},"ide/move-ide":{"id":"ide/move-ide","title":"Movide","description":"Movide is an online Integrated Development Environment (IDE) that redefines Move programming for blockchain networks such as Movement and SUI. It is designed to streamline Move development by providing a simple, lightweight UI packed with feature-rich tools. Much like Remix for Solidity, Movide brings a dedicated Move-based IDE to the browser, enabling seamless compiling, building, and deploying of Move packages on-chain. What sets Movide apart is its unique ability to load Move packages directly from GitHub or verified on-chains packages into the IDE, facilitating a novel solution for developers aiming to deploy on Movement.","sidebar":"tutorialSidebar"},"ide/sol-ide-contract":{"id":"ide/sol-ide-contract","title":"Import a contract address in Solide","description":"This document provides instructions on how to load a verified smart contract directly from a chain using an iframe or via SolideIDE.","sidebar":"tutorialSidebar"},"ide/sol-ide-github":{"id":"ide/sol-ide-github","title":"Import a Solidty from Github to Solide","description":"This document provides instructions on how to load a smart contract directly from GitHub using an iframe or via SolideIDE.","sidebar":"tutorialSidebar"},"ide/stylus-ide":{"id":"ide/stylus-ide","title":"Stylide","description":"Stylide is an advanced web-based Integrated Development Environment (IDE) designed for Stylus smart contracts. Tailored for developers working with the Stylus blockchain, Stylide offers a streamlined and intuitive interface that enhances the smart contract development process. It provides essential tools for writing, compiling, and deploying Stylus contracts directly from the browser. With features similar to those found in established IDEs like Remix for Solidity, Stylide supports seamless integration with blockchain networks, enabling efficient contract management and deployment. Its unique capabilities include loading and interacting with Stylus contracts, offering developers a robust platform for building and testing smart contracts in the Stylus ecosystem.","sidebar":"tutorialSidebar"},"ide/sway-ide":{"id":"ide/sway-ide","title":"Swayide","description":"SwayIDE is a specialized Integrated Development Environment designed for developing Sway smart contracts on the Fuel blockchain. It provides a user-friendly interface that facilitates writing, compiling, and deploying Sway contracts with ease. Featuring integrated support for project management and deployment, SwayIDE streamlines the development workflow, offering tools for real-time code analysis, error checking, and network configuration. With built-in support for various Fuel networks, including devnet, testnet, and mainnet, SwayIDE enhances the efficiency of smart contract development and deployment processes, making it a valuable tool for developers working within the Fuel ecosystem.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introduction","description":"Solide is an open source lightweight, web-based Solidity Integrated Development Environment (IDE) and educational smart contract hub that for developers, educators, and blockchain enthusiasts. Solide offers an intuitive and feature-rich platform designed to empower you on ones journey into blockchain development. By supporting various blockchains and protocols, including Ethereum, Chainlink, OpenZeppelin, and many more, Solide provides a comprehensive platform for constructing, utilizing, and exploring smart contracts. Its user-friendly IDE, capable of seamless integration with tutorials and demos, facilitates an interactive learning environment. Solide\'s overarching goal is to serve as both an educational tool and a developer tool, promoting practical understanding and development across the Ethereum ecosystem.","sidebar":"tutorialSidebar"},"pol/contribution":{"id":"pol/contribution","title":"Contribution","description":"","sidebar":"tutorialSidebar"},"pol/intro":{"id":"pol/intro","title":"Introduction","description":"Proof of Learn (POL) is an interactive, blockchain-based learning platform designed to revolutionize Web3 education. By engaging users directly with smart contracts and on-chain transactions, POL shifts the focus from traditional question-answer formats to hands-on learning experiences. Users can complete quests, deploy contracts, and verify their progress through on-chain transaction hashes, earning POL POAP NFTs as proof of their achievements.","sidebar":"tutorialSidebar"},"pol/quest/quest-deployment":{"id":"pol/quest/quest-deployment","title":"Quest Deployment","description":"","sidebar":"tutorialSidebar"},"pol/quest/quest-transaction":{"id":"pol/quest/quest-transaction","title":"Quest Transaction","description":"","sidebar":"tutorialSidebar"},"supported-chains":{"id":"supported-chains","title":"Support Chains","description":"Solide IDE aims to support a wide range of blockchain protocols and ecosystems. Support Chains are designed to enhance your development experience by providing comprehensive assistance in loading and exploring verified smart contracts different blockchain networks and protocols. The following is an overview of the supported chains and protocols in Solide IDE, with more to be added in the future.","sidebar":"tutorialSidebar"},"tools/awesome-solidity-learn":{"id":"tools/awesome-solidity-learn","title":"Awesome Learn Solidity [![Awesome](https://cdn.rawgit.com/sindresorhus/awesome/d7305f38d29fed78fa85652e3a63e154dd8e8829/media/badge.svg)](https://github.com/sindresorhus/awesome)","description":"A collection of awesome Solidity resources and guides.","sidebar":"tutorialSidebar"},"tools/solidity-database":{"id":"tools/solidity-database","title":"Solidity Database","description":"Decentralised Open Source Contract Explorer.","sidebar":"tutorialSidebar"},"tools/web3-contract-plugin":{"id":"tools/web3-contract-plugin","title":"Web3 Plugin Contracts","description":"Contract Plugin for Web3.js.","sidebar":"tutorialSidebar"}}}}')}}]);